import React from 'react';
import '../Styles/Landing.css';

const Landing = () => {
  return (
    <div className="landing-container">
      <h1>Welcome to My Personal Website!</h1>
      <p>This is the landing page.</p>
    </div>
  );
};

export default Landing;
